subSubSection.paragraph:
Aedeagus (
paratype
)

(
Fig. 21
). Basal piece longer than wide, laterally parallel-sided, dorsally open, apically rounded; remaining parts elongate, constricted laterally just above the basal piece, laterally sinuous; parameres elongate, apically rounded, triangular-shaped lateral tooth present near apices; median lobe elongate and narrow, apically pointed, deeply and narrowly bifid, longer than parameres.
